import React from 'react';
import Layout from '../components/Layout'; 

function Dashboard() {
  return (
    <Layout>
      <h1>Dashboard</h1>
      <p>Welcome to your Dashboard. Here you can manage your movie wishlist, profile, and more.</p>
    </Layout>
  );
}

export default Dashboard;
